import logo from './logo.svg';
import './App.css';
import LoginPage from './screen/LoginPage';
import CalendarPage from './screen/CalendarPage';

function App() {
  const isLoggedIn = true;


  return (
    <div className="App">
      {isLoggedIn?<CalendarPage/>:<LoginPage/>}
    </div>
  );
}

export default App;
